import React, { Component } from 'react';
import App from './App';


class Register extends Component {
  constructor(props) {
    super(props);
    this.state = {
      login: false,
      Authentication: false
    };
  }

  render() {
    return (
      <>
      <h1>Register</h1>
        <div id="RegisterBox">
          <label>email</label>
          <input></input>
          <label>password</label>
          <input></input>
          <button onClick={this.navigateRegister}>Login To Account</button>
        </div>
        {this.state.Authentication && (
          <App />
        )}
      </>
    );
  }
}

export default Register;
